const SearchBox = ({ placeholder }) => {
    return (
        <div className='search-box'>
            <input type="text" name='search' className='input' placeholder={placeholder} />
        </div>
    )
}

SearchBox.defaultProps = {
    title: "Google Search",
}

SearchBox.propTypes = {
    title: PropTypes.string.isRequired,
}

